import React from 'react';
import { Link } from 'react-router-dom';
import { HeaderStyled } from './Header.style';

const Header = () => {
  return (
    <HeaderStyled>
      <nav>
        <div>Mon Logo</div>
        <ul>
          <li><Link to="/home">Mon Blog</Link></li>
          <li><Link to="/admin">Admin</Link></li>
          <li><Link to="/connexion">Connexion</Link></li>
        </ul>
      </nav>
    </HeaderStyled>
  );
}

export { Header };
